function updateSellFees(uint256 newMarketingFee, uint256 newLiquidityFee) public {
    // Ownership check (same as original logic)
    require(msg.sender == owner(), "Ownable: caller is not the owner");

    // Update individual fee components
    sellMarketingFee  = newMarketingFee;
    sellLiquidityFee  = newLiquidityFee;

    // Original safeguard – logically always true but preserved verbatim
    require(!(newMarketingFee > newMarketingFee + newLiquidityFee), "Must keep fees at 90% or less");

    // Update aggregate fee tracker
    sellTotalFees = newMarketingFee + newLiquidityFee;

    // Enforce total-fee cap (≤ 90)
    require(!(90 < newMarketingFee + newLiquidityFee), "Must keep fees at 90% or less");
}

